    [],nt"revision_timestamp": "2016-07-27T22:49:49.314473",nt"name": "necedah-national-wildlife-refuge-narrative-report-may-june-july-august-1960",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from May through August of 1960. The report begins by summarizing
    the weather conditions, habitat conditions, water conditions, and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, raptors, reptiles, fish,
    and disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and vegetation control.
    Resource management is outlined; topics include grazing, haying, and timber removal.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and Refuge participation. N-R forms and photographs are attached.",nt"license_title":
